import React from 'react';
import './App.css';
import {Route, Routes} from 'react-router-dom';
import Main from 'views/Main';
//컴포넌트: Application 컴포넌트

function App() {
  //컴포넌트: Application 컴포넌트 렌더링
  // 메인화면:  '/' 컴포넌트 이름: Main
  // 로그인+회원가입 : '/auth' 컴포넌트 이름: Authentication
  // 검색화면
  // 친구와 함께하기 화면
  return (
    <Routes>
      <Route path='/' element={<Main />} />
    </Routes>
  );
}

export default App;
